import React ,{ Component }from "react";
import {  FaAdn } from "react-icons/fa";
import { FiLayers , FiCode , FiMonitor, FiCodepen, FiAlertOctagon } from "react-icons/fi";

const ServiceList = [
    {
        icon: <FiCodepen />,
        title: 'Node JS',
        description: 'Modern platform building your website organize.'
    },
    {
        icon: <FiCode />,
        title: 'Next JS',
        description: 'Platform by React JS, full core component APIs'
    },
    {
        icon: <FiLayers/>,
        title: 'UI/UX Design',
        description: 'Start on scratch to live design'
    },
    {
        icon: <FiMonitor />,
        title: 'Responsive Website',
        description: 'Create your website using ready-made styles and layouts.'
    },
    {
        icon: <FiAlertOctagon />,
        title: 'Privacy',
        description: 'Data protection is of a particularly high priority'
    },
    {
        icon: <FaAdn />,
        title: 'Performance',
        description: 'Minified production build.'
    },
]


class ServiceThree extends Component{
    render(){
        const {column } = this.props;
        const ServiceContent = ServiceList.slice(0 , this.props.item);
        
        return(
            <React.Fragment>
                <div className="row service-main-wrapper">
                    {ServiceContent.map( (val , i) => (
                        <div className={`${column}`} key={i}>
                            <a href="/service-details">
                                <div className="service service__style--2 text-left bg-gray">
                                    <div className="icon">
                                        {val.icon}
                                    </div>
                                    <div className="content">
                                        <h3 className="title">{val.title}</h3>
                                        <p>{val.description}</p>
                                    </div>
                                </div>
                            </a>
                        </div>
                    ))}
                </div>
            </React.Fragment>
        )
    }
}
export default ServiceThree;
